import React from 'react';

function Match({ match }) {
  if (!match) return null;

  const { champion, win, items, kills, gameEndTimestamp, version } = match;
  const matchOutcome = win ? 'Won' : 'Lost';

  // Champion image
  const championImage = (
    <img
      src={`https://ddragon.leagueoflegends.com/cdn/${version}/img/champion/${champion}.png`}
      alt={`${champion}`}
      className="champion-image"
      style={{ width: '50px', height: '50px', borderRadius: '5px', marginRight: '10px', verticalAlign: 'middle' }}
    />
  );

  // Item images (filter out items with ID 0)
  const itemImages = items
    .filter(itemId => itemId > 0)
    .map((itemId, index) => (
      <img
        key={`${itemId}-${index}`}  // Ensure each key is unique by combining itemId and index
        src={`http://ddragon.leagueoflegends.com/cdn/${version}/img/item/${itemId}.png`}
        alt={`Item ${itemId}`}
        className="item-image"
        style={{ width: '50px', height: '50px', borderRadius: '5px', marginRight: '5px' }}
      />
    ));

  return (
    <div className="match" style={{ borderBottom: '1px solid #444', padding: '10px 0', marginTop: '15px' }}>
      <div>
        {championImage}
        <strong>Champion:</strong> {champion}
      </div>
      <p><strong>Outcome:</strong> {matchOutcome}</p>
      <p><strong>Kills:</strong> {kills}</p>
      <p><strong>Game End Time:</strong> {new Date(gameEndTimestamp).toLocaleString()}</p>
      <div className="item-images"><strong>Items Used:</strong> {itemImages}</div>
    </div>
  );
}

export default Match;
